window.bookSummaryJSON = "<p>A mute elven archer known only as Killer. Azyrin, a half Winter-orc shaman and his human swordswoman bride, Makha. Drake, the charming, swashbuckling rogue. The fireball-slinging pixie-goblin, Rahiel, and her mini-unicorn, Bill. These are the Gryphonpike Companions. </p> <p>Arriving in Strongwater Barrow, the Companions find the town riddled with plague and death. Ending the curse and saving the survivors means going into the swamps where monsters lurk and witches wait. Sounds like exactly their kind of day. </p> <p><i>Witch Hunt</i> is an adventure fantasy novella. </p>"; 
